ntent/uploads/2015/08/pubtalk_logo2.png could save 1.7KiB (14% reduction).\";i:12;s:112:\"Compressing https://travisbuck.com/wp-content/uploads/2015/08/mgsale_logo.png could save 1.7KiB (24% reduction).\";i:13;s:126:\"Compressing https://travisbuck.com/wp-content/uploads/2016/01/marketingeqlogo-3-140x140.png could save 1.5KiB (11% reduction).\";i:14;s:126:\"Compressing https://travisbuck.com/wp-content/plugins/revslider/rs-plugin/assets/bullet.png could save 1.3KiB (59% reduction).\";i:15;s:107:\"Compressing https://travisbuck.com/wp-content/uploads/2015/11/tblogo.png could save 1.2KiB (27% reduction).\";}}}}s:30:\"MainResourceServerResponseTime\";O:8:\"stdClass\":8:{s:5:\"label\";s:28:\"Improve server response time\";s:4:\"type\";s:6:\"server\";s:3:\"tip\";s:1874:\"<p>Page generation time longer than the recommended 200ms maximum will lower your score here. Much of your page generation time has to do with your hosting provider, but there are a number of steps you can take yourself to improve this score.</p>\n<h5>Recommendations:</h5>\n<ol>\n    <li>Install and configure a full page caching plugin like <a target=\"_blank\" href=\"https://wordpress.org/plugins/wp-super-cache/\">WP Super Cache</a> or <a target=\"_blank\" href=\"https://wordpress.org/plugins/batcache/\">Batcache</a>. This can substantially improve your response time for logged out visitors and search engine bots.</li>\n    <li>Usually your installed WordPress plugins have the greatest impact on your page generation time. Some are horribly inefficient, and some are just resource intensive. Test the performance impact of your plugins using a plugin like <a target=\"_blank\" href=\"https://wordpress.org/plugins/query-monitor/\">Query Monitor</a>, then remove the worst offenders, or replace them with a suitable alternative.</li>\n</ol>\n<br>\n<h5>Advanced Recommendations:</h5>\n<ol>\n    <li>Confirm with your host that you are running at least PHP 5.5 and <a target=\"_blank\" href=\"http://php.net/manual/en/intro.opcache.php\">OPcache</a> is enabled in your site\'s PHP configuration.</li>\n    <li>Install and configure an <a target=\"_blank\" href=\"https://codex.wordpress.org/Class_Reference/WP_Object_Cache#Persistent_Cache_Plugins\">object caching plugin</a> on your site (Redis or Memcached recommended).</li>\n    <li>Ask your host if they support PHP7 or HHVM to help your PHP execute faster.</li>\n</ol>\n<p>Note that many of the major <a target=\"_blank\" href=\"http://hostingreviews.io/web-hosting/managed-wordpress\">managed WordPress hosting</a> providers provide full page caching, object caching, and more modern and optimised PHP configurations as part of their offerings.</p>\";s:6:\"impact\";d:22.809999999999998721023075631819665431976318359375;s:12:\"impact_score\";i:89;s:18:\"impact_score_class\";s:1:\"b\";s:7:\"summary\";s:0:\"\";s:9:\"urlblocks\";a:1:{i:0;O:8:\"stdClass\":1:{s:6:\"header\";s:324:\"In our test, your server responded in 2.5 seconds. There are many factors that can slow down your server response time. <a href=\"https://developers.google.com/speed/docs/insights/Server\" target=\"_blank\">Please read our recommendations</a> to learn how you can monitor and measure where your server is spending the most time.\";}}}s:22:\"LeverageBrowserCaching\";O:8:\"stdClass\":8:{s:5:\"label\";s:24:\"Leverage browser caching\";s:4:\"type\";s:9:\"resources\";s:3:\"tip\";s:1115:\"<p>WP Hummingbird is the fastest, simplest way to improve this score! You can use it to quickly enable the recommended caching headers for each media type.</p><p><a class=\"button button-full button-a-b\" href=\"admin.php?page=wphb-caching\"><span class=\"wpdui-fi wpdui-fi-wordpress\"></span>Configure Browser Caching</a></p>\n<p>Unfortunately there is no way to control the caching headers for external resources included from another domain. If a file from a different domain is in the BENCHMARKS list above it is likely being added by a plugin or your theme. It is VERY common for JavaScript or CSS for 3rd party services like analytics, ad networks, etc to purposely have cache periods lower than the recommended, lowering your score. You can:</p>\n<ol>\n    <li>Deactivate plugins one by one to find the culprit, then remove or find a comparable substitute.</li>\n    <li>Ignore this recommendation and continue using the plugin/theme or service despite the affect it may have on your score. The value of certain services may be worth the minimal impact that one script has on your overall performance score.</li>\n</ol>\";s:6:\"impact\";d:14.4613095238099997885683478671126067638397216796875;s:12:\"impact_score\";i:93;s:18:\"impact_score_class\";s:1:\"b\";s:7:\"summary\";s:188:\"Setting an expiry date or a maximum age in the HTTP headers for static resources instructs the browser to load previously downloaded resources from local disk rather than over the network.\";s:9:\"urlblocks\";a:1:{i:0;O:8:\"stdClass\":2:{s:6:\"header\";s:166:\"<a href=\"https://developers.google.com/speed/docs/insights/LeverageBrowserCaching\" target=\"_blank\">Leverage browser caching</a> for the following cacheable resources:\";s:4:\"urls\";a:30:{i:0;s:133:\"https://maps.googleapis.com/maps/api/js?key=AIzaSyDm7mKzTHlw2f0FuWW-YFG1DrvnsJDivLM&ver=8d6a20d7aca590c3b455909d526d235c (30 minutes)\";i:1;s:63:\"https://platform-api.sharethis.com/js/sharethis.js (60 minutes)\";i:2;s:51:\"https://google-analytics.com/analytics.js (2 hours)\";i:3;s:55:\"https://www.google-analytics.com/analytics.js (2 hours)\";i:4;s:89:\"https://travisbuck.com/wp-content/plugins/contact-form-7/images/ajax-loader.gif (4 hours)\";i:5;s:89:\"https://travisbuck.com/wp-content/plugins/revslider/rs-plugin/assets/bullet.png (4 hours)\";i:6;s:93:\"https://travisbuck.com/wp-content/plugins/revslider/rs-plugin/assets/large_left.png (4 hours)\";i:7;s:94:\"https://travisbuck.com/wp-content/plugins/revslider/rs-plugin/assets/large_right.png (4 hours)\";i:8;s:89:\"https://travisbuck.com/wp-content/plugins/revslider/rs-plugin/assets/loader.gif (4 hours)\";i:9;s:90:\"https://travisbuck.com/wp-content/plugins/revslider/rs-plugin/assets/shadow2.png (4 hours)\";i:10;s:82:\"https://travisbuck.com/wp-content/themes/buck/fonts/icomoon.woff?-axpzgc (4 hours)\";i:11;s:78:\"https://travisbuck.com/wp-content/uploads/2015/08/NWMClogo_wht-1.png (4 hours)\";i:12;s:91:\"https://travisbuck.com/wp-content/uploads/2015/08/WordPress-Coal-Gray-600x315.png (4 hours)\";i:13;s:84:\"https://travisbuck.com/wp-content/uploads/2015/08/cascade-shot-600x950.png (4 hours)\";i:14;s:77:\"https://travisbuck.com/wp-content/uploads/2015/08/devices-slide.png (4 hours)\";i:15;s:77:\"https://travisbuck.com/wp-content/uploads/2015/08/ferret_transp.png (4 hours)\";i:16;s:84:\"https://travisbuck.com/wp-content/uploads/2015/08/kickeez-web-600x1370.png (4 hours)\";i:17;s:75:\"https://travisbuck.com/wp-content/uploads/2015/08/mgsale_logo.png (4 hours)\";i:18;s:77:\"https://travisbuck.com/wp-content/uploads/2015/08/pubtalk_logo2.png (4 hours)\";i:19;s:81:\"https://travisbuck.com/wp-content/uploads/2015/08/rex-shot-600x1628.png (4 hours)\";i:20;s:82:\"https://travisbuck.com/wp-content/uploads/2015/08/sunmai_transp_logo.png (4 hours)\";i:21;s:80:\"https://travisbuck.com/wp-content/uploads/2015/08/woocommerce_logo.png (4 hours)\";i:22;s:70:\"https://travisbuck.com/wp-content/uploads/2015/11/tblogo.png (4 hours)\";i:23;s:74:\"https://travisbuck.com/wp-content/uploads/2016/01/comp_slide.jpg (4 hours)\";i:24;s:81:\"https://travisbuck.com/wp-content/uploads/2016/01/googleglass_slide.jpg (4 hours)\";i:25;s:76:\"https://travisbuck.com/wp-content/uploads/2016/01/hacked_slide.jpg (4 hours)\";i:26;s:89:\"https://travisbuck.com/wp-content/uploads/2016/01/marketingeqlogo-3-140x140.png (4 hours)\";i:27;s:83:\"https://travisbuck.com/wp-content/uploads/2016/01/senior_logo-140x140.png (4 hours)\";i:28;s:71:\"https://travisbuck.com/wp-content/uploads/2016/04/18c6ed4.jpg (4 hours)\";i:29;s:71:\"https://travisbuck.com/wp-content/uploads/2016/04/39874db.jpg (4 hours)\";}}}}s:31:\"MinimizeRenderBlockingResources\";O:8:\"stdClass\":8:{s:5:\"label\";s:32:\"Remove render blocking resources\";s:4:\"type\";s:9:\"resources\";s:3:\"tip\";s:1009:\"<p>WP Hummingbird helps you move blocking JavaScript to your footer, and combine and compress blocking CSS in your header. Use WP Hummingbird to:</p>\n<ol>\n    <li>Move as many compatible scripts as possible to your footer.</li>\n    <li>Optimise your CSS by combining and minifying as many compatible files as possible.</li>\n    <li>Then run a new test to check what impact it makes on your score.</li>\n</ol>\n<p><a class=\"button button-full button-a-b\" href=\"admin.php?page=wphb\"><span class=\"wpdui-fi wpdui-fi-wordpress\"></span>Configure Script Deferring</a></p>\n<p><strong>Note that it can be very hard to get a perfect score for this rule.</strong> Some plugins and themes due to their design may not be able to handle their scripts deferred to the footer without breaking, so will have to be left in their original position. And often combining and minifying all CSS files will not completely remove their impact on your score. Just try multiple combinations to improve this score as much as possible.</p>\n\";s:6:\"impact\";i:4;s:12:\"impact_score\";i:98;s:18:\"impact_score_class\";s:1:\"b\";s:7:\"summary\";s:83:\"Your page has 1 blocking CSS resources. This causes a delay in rendering your page.\";s:9:\"urlblocks\";a:2:{i:0;O:8:\"stdClass\":1:{s:6:\"header\";s:247:\"None of the above-the-fold content on your page could be rendered without waiting for the following resources to load. Try to defer or asynchronously load blocking resources, or inline the critical portions of those resources directly in the HTML.\";}i:1;O:8:\"stdClass\":2:{s:6:\"header\";s:139:\"<a href=\"https://developers.google.com/speed/docs/insights/OptimizeCSSDelivery\" target=\"_blank\">Optimize CSS Delivery</a> of the following:\";s:4:\"urls\";a:1:{i:0;s:696:\"https://travisbuck.com/wp-content/plugins/bwp-minify/min/?f=wp-content/uploads/2017/08/d44c5cf60494b82e8280d318bbad5566.css,wp-content/uploads/2017/08/bd85d48ca966cbce86c571e80ad5cca1.css,wp-content/uploads/2017/08/4fa5b3ee026f28df33ada76e5301d04b.css,wp-content/uploads/2017/08/71a485e5e368d15416865a5489ea14c8.css,wp-content/uploads/2017/08/b003a9dd51a7281aa2045a1b8729c7a0.css,wp-content/themes/buck/font-awesome/css/font-awesome.min.css,wp-content/uploads/2017/08/64e0341c7942910524c0c9b904402cc9.css,wp-content/uploads/2017/08/b437c107926ddd24c64e6915ccdffb43.css,wp-content/uploads/2017/08/2168b0d6fd62053a74dc0246d74715aa.css,wp-content/uploads/2017/08/6568497cf493364899f4625d9cf776ce.css\";}}}}s:10:\"MinifyHTML\";O:8:\"stdClass\":8:{s:5:\"label\";s:11:\"Minify HTML\";s:4:\"type\";s:7:\"content\";s:3:\"tip\";s:306:\"<p>Unfortunately there isn\'t currently a reliable way to minify HTML via a WordPress plugin or commonly installed server modules. Luckily this generally has minimal, if any impact on your overall score.</p>\n<p><strong>Stay tuned as we are working on adding this feature to WP Hummingbird soon!</strong></p>\";s:6:\"impact\";d:0.163700000000000012168044349891715683043003082275390625;s:12:\"impact_score\";i:100;s:18:\"impact_score_class\";s:1:\"a\";s:7:\"summary\";s:145:\"Compacting HTML code, including any inline JavaScript and CSS contained in it, can save many bytes of data and speed up download and parse times.\";s:9:\"urlblocks\";a:1:{i:0;O:8:\"stdClass\":2:{s:6:\"header\";s:183:\"<a href=\"https://developers.google.com/speed/docs/insights/MinifyResources\" target=\"_blank\">Minify HTML</a> for the following resources to reduce their size by 1.6KiB (12% reduction).\";s:4:\"urls\";a:1:{i:0;s:86:\"Minifying https://travisbuck.com/ could save 1.6KiB (12% reduction) after compression.\";}}}}s:24:\"PrioritizeVisibleContent\";O:8:\"stdClass\":7:{s:5:\"label\";s:26:\"Prioritize visible content\";s:4:\"type\";s:7:\"content\";s:3:\"tip\";s:792:\"<p>This score is very hard to improve unless you have custom-coded your theme and plugins with these optimizations in mind from the beginning. However the vast majority of WordPress sites are not built that way. Luckily the overall impact on your score from this rule is usually small.</p>\n<h5>Recommendations:</h5>\n<ol>\n    <li>Sometimes following the \"Remove render-blocking resources\" recommendations can improve this score as a side effect, so try that first.</li>\n    <li>Try switching to a different theme to see if it improves your score.</li>\n    <li>Ignore this recommendation and continue using your theme despite the affect it may have on your overall score. This is a perfectly valid option, sometimes there is an unavoidable tradeoff between features and performance.</li>\n</ol>\n\";s:6:\"impact\";i:0;s:12:\"impact_score\";i:100;s:18:\"impact_score_class\";s:1:\"a\";s:7:\"summary\";s:209:\"You have the above-the-fold content properly prioritized. Learn more about <a href=\"https://developers.google.com/speed/docs/insights/PrioritizeVisibleContent\" target=\"_blank\">prioritizing visible content</a>.\";}s:9:\"MinifyCss\";O:8:\"stdClass\":7:{s:5:\"label\";s:10:\"Minify CSS\";s:4:\"type\";s:8:\"resource\";s:3:\"tip\";s:230:\"<p>WP Hummingbird is the fastest, simplest way to minify your CSS files!</p><p><a class=\"button button-full button-a-b\" href=\"admin.php?page=wphb\"><span class=\"wpdui-fi wpdui-fi-wordpress\"></span>Minify with WP Hummingbird</a></p>\";s:6:\"impact\";i:0;s:12:\"impact_score\";i:100;s:18:\"impact_score_class\";s:1:\"a\";s:7:\"summary\";s:149:\"Your CSS is minified. Learn more about <a href=\"https://developers.google.com/speed/docs/insights/MinifyResources\" target=\"_blank\">minifying CSS</a>.\";}s:21:\"EnableGzipCompression\";O:8:\"stdClass\":7:{s:5:\"label\";s:18:\"Enable compression\";s:4:\"type\";s:6:\"server\";s:3:\"tip\";s:857:\"<p>WP Hummingbird is the fastest, simplest way to improve this score! You can use it to enable GZIP compression for all compressible resources.</p><p><a class=\"button button-full button-a-b\" href=\"admin.php?page=wphb-gzip\"><span class=\"wpdui-fi wpdui-fi-wordpress\"></span>Configure GZIP Compression</a></p>\n<p>Unfortunately there is no way to compress external resources included from another domain. If a file from a different domain is in the BENCHMARKS list above it is likely being added by a plugin or your theme. You can:</p>\n<ol>\n    <li>Deactivate plugins one by one to find the culprit, then remove or find a comparable substitute.</li>\n    <li>Ignore this recommendation and continue using the plugin/theme despite the affect it may have on your score. This may be a perfectly valid option for some services you just can\'t live without.</li>\n</ol>\";s:6:\"impact\";i:0;s:12:\"impact_score\";i:100;s:18:\"impact_score_class\";s:1:\"a\";s:7:\"summary\";s:166:\"You have compression enabled. Learn more about <a href=\"https://developers.google.com/speed/docs/insights/EnableCompression\" target=\"_blank\">enabling compression</a>.\";}s:25:\"AvoidLandingPageRedirects\";O:8:\"stdClass\":7:{s:5:\"label\";s:28:\"Avoid landing page redirects\";s:4:\"type\";s:6:\"server\";s:3:\"tip\";s:556:\"<p>If you have a redirect leading to a different subdomain, you may need to <a target=\"_blank\" href=\"https://codex.wordpress.org/Changing_The_Site_URL\">update the site_url and home_url options</a> of your site to match your preference. Redirects can also be caused by a plugin, or your theme. Disabling plugins one at a time can help you find the culprit. They can also be caused by a rule in your htaccess file or hosting control panel.</p><p>If you are unsure where the redirect is coming from speak to your host to see if they can resolve the issue.</p>\";s:6:\"impact\";i:0;s:12:\"impact_score\";i:100;s:18:\"impact_score_class\";s:1:\"a\";s:7:\"summary\";s:172:\"Your page has no redirects. Learn more about <a href=\"https://developers.google.com/speed/docs/insights/AvoidRedirects\" target=\"_blank\">avoiding landing page redirects</a>.\";}s:16:\"MinifyJavaScript\";O:8:\"stdClass\":7:{s:5:\"label\";s:17:\"Minify JavaScript\";s:4:\"type\";s:8:\"resource\";s:3:\"tip\";s:799:\"<p>WP Hummingbird is the fastest, simplest way to minify your JavaScript files!</p><p><a class=\"button button-full button-a-b\" href=\"admin.php?page=wphb\"><span class=\"wpdui-fi wpdui-fi-wordpress\"></span>Minify with WP Hummingbird</a></p>\n<p>Unfortunately there is no way to minify JavaScript included from another domain. If a file from a different domain is in the BENCHMARKS list above it is likely being added by a plugin or your theme. You can:</p>\n<ol>\n    <li>Deactivate plugins one by one to find the culprit, then remove or find a comparable substitute.</li>\n    <li>Ignore this recommendation and continue using the plugin/theme despite the affect it may have on your score. This may be a perfectly valid option for some JavaScript files for services you just can\'t live without.</li>\n</ol>\";s:6:\"impact\";i:0;s:12:\"impact_score\";i:100;s:18:\"impact_score_class\";s:1:\"a\";s:7:\"summary\";s:171:\"Your JavaScript content is minified. Learn more about <a href=\"https://developers.google.com/speed/docs/insights/MinifyResources\" target=\"_blank\">minifying JavaScript</a>.\";}}}s:5:\"error\";b:0;}'),(
