buck.com/wp-content/uploads/2015/08/buck_banner.jpg?id=559) !important;background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}\"][vc_column width=\"1/2\" animate=\"fadeinleft\" wap_class=\"\"][vc_single_image image=\"570\" img_size=\"full\" css=\".vc_custom_1453582673373{margin-top: 25px !important;}\"][/vc_column][vc_column width=\"1/2\" animate=\"fadeinright\" wap_class=\"\"][vc_empty_space height=\"40px\"][heading text=\"Who is Travis Buck?\" tag=\"h2\" color=\"#ffffff\" class=\"title-2\"][vc_column_text css=\".vc_custom_1453583132179{margin-top: 20px !important;margin-bottom: 30px !important;}\" el_class=\"slogan\"]\n<div class=\"white\">I build websites, and I\'ve been doing it for a long time.</div>\n<div class=\"white\"></div>\n<div class=\"white\">I built my first website in 1994. This goes back to regular old HTML using notepad and FTP to upload my documents.Â  I\'ve freelanced for a lot of web companies, and I\'ve worked solo building my own company.</div>\n<div class=\"white\"></div>\n<div class=\"white\">I work in many different areas of web development from back end programming (PHP, MySQL, DNS) to front end design (HTML, CSS, and Javascript).</div>\n[/vc_column_text][button icon=\"download\" btntext=\"MY WORK\" btnlink=\"#pricing\" style=\"mwhite\" color=\"#ffffff\" background=\"rgba(234,119,1,0.01)\" border=\"#ffffff\"][button btntext=\"CONTACT ME\" btnlink=\"#contact\" style=\"mwhite\" color=\"#ffffff\" background=\"rgba(255,255,255,0.01)\" border=\"#ffffff\"][button btntext=\"Blog\" btnlink=\"http://travisbuck.com/blog\" style=\"mwhite\"][heading text=\"48% of Technoratiâs Top 100 Blogs Are Managed With WordPress\" tag=\"h3\"][/vc_column][/vc_row][vc_row css=\".vc_custom_1443157815698{padding-top: 105px !important;padding-bottom: 80px !important;}\"][vc_column wap_class=\"\"][heading text=\"WordPress Expert and local legend\" tag=\"h2\" align=\"center\" class=\"title\"][heading text=\"I\'ve worked on WSU.edu, Clark County sites, and international sites\" tag=\"h3\" align=\"center\" class=\"slogan\"][line_solid icon=\"trophy\" style=\"style1\"][ctabox title=\"Do you have a WordPress website? Need a web person who doesn\'t disappear? Someone who started one of the top WordPress companies in the Northwest?\" icon1=\"code\" btn1=\"WordPress Expert\" link1=\"http://travisbuck.com/wordpress\" icon2=\"shield\" btn2=\"My Company\" link2=\"http://northwestmediacollective.com\"][/vc_column][/vc_row][vc_row css=\".vc_custom_1443157815698{padding-top: 105px !important;padding-bottom: 80px !important;}\" el_id=\"pricing\"][vc_column wap_class=\"\"][heading text=\"Recent Web Design work\" tag=\"h2\" align=\"center\" class=\"title\"][heading text=\"Ok so not the most recent, but the good stuff\" tag=\"h3\" align=\"center\" class=\"slogan\"][line_solid icon=\"mug\" style=\"style1\"][/vc_column][vc_column width=\"1/3\" animate=\"fadeinleft\" wap_class=\"\"][vc_text_separator title=\"Cascade Management\" color=\"juicy_pink\"][vc_single_image image=\"584\" img_size=\"medium\" alignment=\"center\"][vc_column_text]A custom CMS solution for a 200+ property website[/vc_column_text][/vc_column][vc_column width=\"1/3\" animate=\"fadeinup\" wap_class=\"\"][vc_text_separator title=\"Kickeez Products\" color=\"juicy_pink\"][vc_single_image image=\"586\" img_size=\"medium\"][vc_column_text]Custom Ecommerce Solution for a high traffic website[/vc_column_text][/vc_column][vc_column width=\"1/3\" animate=\"fadeinright\" wap_class=\"\"][vc_text_separator title=\"Rex Plastics\" color=\"juicy_pink\"][vc_single_image image=\"589\" img_size=\"medium\"][vc_column_text]Custom website using video integrated into the website[/vc_column_text][/vc_column][/vc_row][vc_row css=\".vc_custom_1453673836594{padding-top: 80px !important;padding-bottom: 80px !important;background-image: url(http://travisbuck.com/wp-content/uploads/2015/08/busy_block.jpg?id=617) !important;background-position: center 