'635','0','closed','http://travisbuck.com/?page_id=635','0','closed','','2','[vc_row][vc_column width=\"1/2\"][vc_custom_heading text=\"Expert WordPress Consulting\" use_theme_fonts=\"yes\"][/vc_column][vc_column width=\"1/2\"][vc_custom_heading text=\"WordPress Development\r\nCustom Theme and Plugins\" use_theme_fonts=\"yes\"][/vc_column][/vc_row][vc_row css=\".vc_custom_1457190255530{padding-top: 15px !important;background-image: url(http://travisbuck.com/wp-content/uploads/2016/03/webshadow2.jpg?id=652) !important;}\"][vc_column][vc_row_inner][vc_column_inner width=\"1/4\"][vc_icon icon_fontawesome=\"fa fa-wordpress\" color=\"juicy_pink\" size=\"xl\" align=\"center\"][vc_custom_heading text=\"Since 2008\" font_container=\"tag:h2|text_align:center|color:%23ffffff\" use_theme_fonts=\"yes\"][vc_column_text]<span style=\"color: #ffffff;\">I started developing sites in WordPress over 10 years ago. This started as custom websites for clients, WordPress website fixes, and server migration.</span>[/vc_column_text][/vc_column_inner][vc_column_inner width=\"1/4\"][vc_icon icon_fontawesome=\"fa fa-picture-o\" color=\"juicy_pink\" size=\"xl\" align=\"center\"][vc_custom_heading text=\"Expert Photoshop\" font_container=\"tag:h2|text_align:center|color:%23ffffff\" use_theme_fonts=\"yes\"][vc_column_text]<span style=\"color: #ffffff;\">I\'ve done professional photo retouching for companies like Bloomingdales, Bon Marche, and REI. If you need something done to your photos for a website, I\'m the guy you want to know.</span>[/vc_column_text][/vc_column_inner][vc_column_inner width=\"1/4\"][vc_icon icon_fontawesome=\"fa fa-cloud\" color=\"juicy_pink\" size=\"xl\" align=\"center\"][vc_custom_heading text=\"Web hosting\" font_container=\"tag:h2|text_align:center|color:%23ffffff\" use_theme_fonts=\"yes\"][vc_column_text]<span style=\"color: #ffffff;\">I have been running a web hosting company since 2009.Â  I know the backend technologies behind websites.Â  Over the years, I\'ve changed which companies I recommend based on whats best for the project.</span>[/vc_column_text][/vc_column_inner][vc_column_inner width=\"1/4\"][vc_icon icon_fontawesome=\"fa fa-envelope-o\" color=\"juicy_pink\" size=\"xl\" align=\"center\"][vc_custom_heading text=\"Email Setup\" font_container=\"tag:h2|text_align:center|color:%23ffffff\" use_theme_fonts=\"yes\"][vc_column_text]<span style=\"color: #ffffff;\">Your email is the one thing that kid in the coffee shop will overlook. I have worked with a lot of different email setups, and know how to move a website and email without causing downtime.</span>[/vc_column_text][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner][vc_text_separator title=\"Too many call themselves Experts\" color=\"orange\"][vc_column_text]\r\n<h4><span style=\"color: #ffffff;\">Countless people hold themselves out as WordPress experts, but donât have the depth of knowledge and skills to code websites. WordPress is easy - This phrase alone should scare anyone.Â  WordPress is easy to install, but not easy to implement.</span></h4>\r\n[/vc_column_text][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row css=\".vc_custom_1457354566378{margin-top: 20px !important;}\"][vc_column width=\"1/2\"][vc_column_text]\r\n<h2>Search Engines and WordPress</h2>\r\nGoogle has made a significant updateÂ to its search algorithm impacting the way websites are ranked when performing searches. If your site isnât mobile friendly, your business is going to suffer.\r\n<h2>Responsive Websites and WordPress</h2>\r\nWordPress is a great platform to develop a responsive website on.Â  Every element on the page needs to be thought out and planned how it will display on mobile.\r\n<h2>Security and WordPress</h2>\r\nWordPress is secure.Â  It powers over 25% of all websites on the internet. This means it has a large target on it\'s back. The community behind WordPress is made up of developers around the world. Updates are constantly happening to stay ahead of the hacks.Â  Hacks do happen on sites that site and don\'t update.Â  I deal with hacked sites weekly, and it is always due to some web person building them a website and not leaving the site owner with a solid backup and update plan. There was no long term solution.\r\n<h2>WordPress recovery plan</h2>\r\nWhats your recovery plan look like if your website goes down tomorrow?Â  Most people tell me they contact the person who built the website 2 years ago.Â  Then they find out the designer has went to work for another company, can\'t remember your logins, and isn\'t available to help. <em>I hear this every week</em>.\r\n\r\nI leave my clients with a plan. The website backs up every 24 hours. I can have them signup on a maintenance plan where my team takes care of all updates.Â  If an update breaks the site, we can revert and work to find out whats wrong with the theme or plugin.[/vc_column_text][/vc_column][vc_column width=\"1/2\"][vc_gallery interval=\"3\" images=\"658,657,676,677\" img_size=\"full\"][/vc_column][/vc_row][vc_row][vc_column][ctabox title=\"Talk to us over at The Northwest Media Collective about your WordPress Project\" btn1=\"Contact us\" link1=\"http://northwestmediacollective.com\" btn2=\"Contact me\" link2=\"mailto:travis@northwestmediacollective.com\"][/vc_column][/vc_row]','','2016-03-05 14:07:49','2016-03-05 14:07:49','','','2016-03-07 13:58:55','2016-03-07 13:58:55','wordpress','0','','publish','WordPress','page',''),(
