hanged which companies I recommend based on whats best for the project.</span>[/vc_column_text][/vc_column_inner][vc_column_inner width=\"1/4\"][vc_icon icon_fontawesome=\"fa fa-envelope-o\" color=\"juicy_pink\" size=\"xl\" align=\"center\"][vc_custom_heading text=\"Email Setup\" font_container=\"tag:h2|text_align:center|color:%23ffffff\" use_theme_fonts=\"yes\"][vc_column_text]<span style=\"color: #ffffff;\">Your email is the one thing that kid in the coffee shop will overlook. I have worked with a lot of different email setups, and know how to move a website and email without causing downtime.</span>[/vc_column_text][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner][vc_text_separator title=\"Too many call themselves Experts\" color=\"orange\"][vc_column_text]\r\n<h4><span style=\"color: #ffffff;\">Countless people hold themselves out as WordPress experts, but donât have the depth of knowledge and skills to code websites. WordPress is easy - This phrase alone should scare anyone.Â  WordPress is easy to install, but not easy to implement.</span></h4>\r\n[/vc_column_text][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row css=\".vc_custom_1457354566378{margin-top: 20px !important;}\"][vc_column width=\"1/2\"][vc_column_text]\r\n<h2>Search Engines and WordPress</h2>\r\nGoogle has made a significant updateÂ to its search algorithm impacting the way websites are ranked when performing searches. If your site isnât mobile friendly, your business is going to suffer.\r\n<h2>Responsive Websites and WordPress</h2>\r\nWordPress is a great platform to develop a responsive website on.Â  Every element on the page needs to be thought out and planned how it will display on mobile.[/vc_column_text][/vc_column][vc_column width=\"1/2\"][vc_gallery interval=\"3\" images=\"658,657,676,677\" img_size=\"full\"][/vc_column][/vc_row][vc_row][vc_column][/vc_column][/vc_row]','','2016-03-07 13:06:04','