rs around the world. Updates are constantly happening to stay ahead of the hacks.Â  Hacks do happen on sites that site and don\'t update.Â  I deal with hacked sites weekly, and it is always due to some web person building them a website and not leaving the site owner with a solid backup and update plan. There was no long term solution.\r\n<h2>WordPress recovery plan</h2>\r\nWhats your recovery plan look like if your website goes down tomorrow?Â  Most people tell me they contact the person who built the website 2 years ago.Â  Then they find out the designer has went to work for another company, can\'t remember your logins, and isn\'t available to help. <em>I hear this every week</em>.\r\n\r\nI leave my clients with a plan. The website backs up every 24 hours. I can have them signup on a maintenance plan where my team takes care of all updates.Â  If an update breaks the site, we can revert and work to find out whats wrong with the theme or plugin.[/vc_column_text][/vc_column][vc_column width=\"1/2\"][vc_gallery interval=\"3\" images=\"658,657,676,677\" img_size=\"full\"][/vc_column][/vc_row][vc_row][vc_column][/vc_column][/vc_row]','','2016-03-07 13:54:16','2016-03-07 13:54:16','','','2016-03-07 13:54:16','2016-03-07 13:54:16','635-revision-v1','635','','inherit','WordPress','revision',''),(
