'716','0','open','http://travisbuck.com/?p=716','0','open','','2','<img class=\"alignnone wp-image-719 size-full\" src=\"http://travisbuck.com/wp-content/uploads/2016/05/iStock_000067967685_Small.jpg\" alt=\"developer stealing money from computer\" width=\"808\" height=\"594\" />\r\n\r\nFind a web person that refers to themselves as a developer not a web designer.Â  Anyone calling themselves a web developer will write code. Just like we have bad gerneral contractors running around working on homes, we have bad web developers running around working on sites. The web design industry is worse though. We don\'t need to even buy a truck and a ladder to look like a professional.Â  Basically, just go buy a 300.00 laptop from Bestbuy and watch a couple youtube videos. I see a lot of poorly written amateur code.Â  Every week I talk to someone who had a so called web designer build their website.Â  Something broke, and now this web designer is gone.Â  The reality is that this web designer probably did a 100 to 200 dollar fix, and its not enough money to make a living. With no skin in the game, they are outa here.\r\n<blockquote>\r\n<div>If you think it\'s expensive to hire a professional to do the job, wait until you hire an amateur - Red Adair</div></blockquote>\r\nExpect a web developers hourly rate to be higher. Not because they all drive convertables, simply because our time is limited.Â  Here is a good example.Â  I have the average small business owner contacting me needing website help, and I have smaller web designers and developer friends that have websites needing work.Â  Time is just limited.\r\n\r\nI always tell people watch out for the kid in the coffee shop. Mostly because I hear stories from clients. Things like, \"I met them at starbucks and gave them the check for 4000.00. Now we can\'t get ahold of them\".Â  A client last week said, \"He met me in a coffee shop and he was kind of creepy\".Â  Another one told me she met the designer over coffee, and he gave her everything for her website on a thumbdrive.Â  I hear a war story every week.\r\n\r\nSkip that part, and find a small web agency.Â  Most these coffee shop heros are probably working at a small agency anyways.Â  The hourly rate will be a little higher, but you have a better chance that the company will still be in business next year when you want to expand and grow your website.\r\n\r\n[yasr_overall_rating]','','2016-05-03 12:49:05','2016-05-03 12:49:05','','','2016-06-04 12:12:32','2016-06-04 12:12:32','hire-a-web-developer-the-first-time','0','','publish','Hire a web developer the first time','post',''),(
