'739','0','open','http://travisbuck.com/?p=739','0','open','','2','Did you login to your WordPress admin area and find that all your images in the media are broken? There is a hack floating around out in cyber space that will attempt to load scripts in your uploads directory. If your media area in the admin of your site shows empty boxes, than it probably means something was added to your wp-content/uploads directory.<img class=\"alignnone size-full wp-image-740\" src=\"http://travisbuck.com/wp-content/uploads/2016/07/media-blank.jpg\" alt=\"media-blank\" width=\"1527\" height=\"672\" />\r\n\r\nAfter some digging around, I found the very first directory 2013 had some image files with long names starting something like 0O and a string of numbers.Â  They looked fishy, so I previewed the url in my browser and the anti-virus program disabled them with a warning.Â  The first step was to dig through the uploads folder and delete out these suspicous looking images.<img class=\"alignright size-full wp-image-741\" src=\"http://travisbuck.com/wp-content/uploads/2016/07/ftp-uploads-folder.jpg\" alt=\"ftp-uploads-folder\" width=\"555\" height=\"325\" />\r\n\r\nLastly, look for a rogue .htaccess file sitting in the root of your wp-content/uploads/ directory.Â  Remove the file, and your media area in the WordPress admin area should display images again. [yasr_overall_rating]','','2016-07-06 11:52:54','2016-07-06 11:52:54','','','2016-07-06 11:52:54','2016-07-06 11:52:54','wordpress-media-empty-image-boxes','0','','publish','WordPress media empty image boxes','post',''),(
