aster own your domain','revision',''),(
'753','0','open','http://travisbuck.com/?p=753','0','open','','2','Simple. Your web designer is trying to promote themselves by putting an advertisement on your website.Â  My theory is that the larger this link at the bottom of the website is the worse their skills are.Â  I\'ve seen some with whole logos at the bottom of peoples sites.Â  If you pay a web designer to build you a site and they put a link at the bottom, they should atleast ask for your approval.Â  I\'m telling clients now to go back and invoice that web designer.Â  Charge them 99/month to advertise on your site.Â  I bet that link goes away real fast.\r\n\r\nThe concept behind that link. One of the ranking factors with Google is sites that link to your site.Â  Now if you build a lot of websites and they all have links back to your site, Google will see you have a lot of backlinks.Â  This is great for the web designer, but not so great for you.Â  The cost to you is the loss of some of you page power.Â  It looks like your site is linking (voting to+1) to their site.Â  They could simply add a rel=nofollow telling Google not to steal some of your page power and don\'t follow that link. This would just leave them a link at the bottom of your site though, and by itself its just tacky.\r\n\r\nSometimes its worked out early on where the web designer says they want to have a link on your site, and you like them for helping you out. You decide to let them put a link there, that\'s fine.Â  You should really ask the question though about will they use rel=nofollow, because you don\'t want this to hurt your ranking on Google.Â  Better yet, will they put a link to your site from their portfolio or works page?Â  If the link is recipricol it will help both of you on Google.','','2016-08-13 13:31:25','2016-08-13 13:31:25','','','2016-08-13 13:33:12','2016-08-13 13:33:12','why-is-there-a-link-for-the-web-designer-on-my-website','0','','publish','Why is there a link for the web designer on my website','post',''),(
