'760','0','open','http://travisbuck.com/?p=760','0','open','','2','Google annouced on its security blog that they will start shaming sites that are non https.Â  For the most part this is going to affect the sites that collect information like logins or credit card info.Â  This is an attempt to make the internet just a little bit of a safer place.Â  Most shopping cart websites have this green lock in the upper left hand corner.Â  It sounds like Google is going to try to label the upper left hand corner in red to help notify the user this site is unsecure.\r\n\r\nWebsites using https will still have the green lock on their website. These websites indicate an added level of security to normal web browsing experience. A website servered over HTTP could allow someone to potentially look at data or modify it on that site.\r\n\r\nGoogle will beginning labeling these websites as unsecure in January of 2017.Â  Time to check with your web person about your websites security.','','2016-09-10 12:03:45','2016-09-10 12:03:45','','','2016-09-10 12:04:08','2016-09-10 12:04:08','google-will-start-to-call-out-unsecure-websites','0','','publish','Google will start to call out unsecure websites','post',''),(
