ound-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}\" el_id=\"testimonials\"][vc_column wap_class=\"\"][testimonial number=\"4\"][/vc_column][/vc_row][vc_row css=\".vc_custom_1453642687397{padding-top: 150px !important;padding-bottom: 150px !important;}\" el_id=\"tech\"][vc_column wap_class=\"\"][heading text=\"Technologies\" tag=\"h2\" align=\"center\" class=\"title\"][heading text=\"I\'ve built ecommerce and large membership sites\" tag=\"h3\" align=\"center\" class=\"slogan\"][line_solid icon=\"user2\" style=\"style1\"][vc_row_inner][vc_column_inner width=\"1/2\"][vc_single_image image=\"783\" img_size=\"full\"][vc_single_image image=\"784\" img_size=\"medium\"][vc_single_image image=\"543\" img_size=\"full\"][/vc_column_inner][vc_column_inner width=\"1/2\"][vc_custom_heading text=\"WordPress and Woocommerce\" use_theme_fonts=\"yes\"][vc_column_text]Woocommerce Expert. I\'ve been building e-commerce sites with WordPress and Woocommerce for over 5 years now.\r\n\r\nI\'ve been building WordPress websites for 10 years now.Â  Custom themes, plugins, or fixing hacked WordPress sites.Â  The amount of time I have spent with WordPress sets me apart from your average web designer.\r\n\r\n[/vc_column_text][vc_custom_heading text=\"Domains and Hosting\" use_theme_fonts=\"yes\"][vc_column_text]I\'ve ran my own web hosting company since 2009.Â  Now this is mostly for myself or friends, but anyone can signup.Â  I stopped promoting my hosting a few years ago since there have been better hosting companies with larger support staff popping up year after year.Â  However, from this experience I know many hosting and server specific issues your website faces. Most things people face when they need to contact hosting support, I can troubleshoot myself.[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row css=\".vc_custom_1453674190796{padding-top: 170px !important;padding-bottom: 170px !important;background-image: url(http://travisbuck.com/wp-content/uploads/2015/08/city_block.jpg?id=618) !important;background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}\" el_id=\"facts\"][vc_column width=\"1/3\" animate=\"fadeinleft\" wap_class=\"\"][facts icon=\"embed\" number=\"220\" title=\"Website Clients\" color=\"#f5f5f5\"][/vc_column][vc_column width=\"1/3\" animate=\"fadeinup\" wap_class=\"\"][facts icon=\"support\" number=\"50\" title=\"Hacked Sites Repaired\" color=\"#f5f5f5\" border=\"yes\"][/vc_column][vc_column width=\"1/3\" animate=\"fadeinright\" wap_class=\"\"][facts icon=\"question2\" number=\"60\" title=\"Emails a day answered\" color=\"#f5f5f5\" border=\"no\"][/vc_column][/vc_row][vc_row css=\".vc_custom_1453673867500{padding-top: 80px !important;padding-bottom: 60px !important;background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}\" el_class=\"no-fixed\" el_id=\"contact\"][vc_column wap_class=\"\"][heading text=\"Get in touch\" tag=\"h2\" align=\"center\" class=\"title\"][heading text=\"Say hello or leave some feedback. I will reply within 24 hours.\" tag=\"h3\" align=\"center\" class=\"slogan\"][line_solid icon=\"envelope\" style=\"style1\"][/vc_column][vc_column animate=\"fadeinup\"][contact-form-7 id=\"138\"][/vc_column][/vc_row]','','2016-10-02 11:51:47','2016-10-02 11:51:47','','','2016-10-02 11:51:47','2016-10-02 11:51:47','203-revision-v1','203','','inherit','WordPress Website Developer Vancouver WA','revision',''),(
'792','0','open','http://travisbuck.com/?p=792','0','open','','2','This month I saw a hacked website with over 420 hacked files. Some were inserted into the websites hosting area, and some were just modified website files.Â  These usually have a MD5 check some (MD5 which stands for Message Digest algorithm 5). Hacked files use this as a long string of letters and numbers that sort of self expands and gives out malisious commands. These code commands can live inside this long string of MD5 gererated numbers waiting for another file to read the code and then act on it.\r\n\r\nI see this a lot in WordPress, and there are just rogue servers online \"ping-ing\" websites trying to find sites with exploits to insert their code.Â  This is why so many people say \"update your plugins\".Â  As coded items like plugin scripts age, new exploits are found all the time.Â  Good developers write patches and fix holes in the code as they find them.\r\n\r\nHere is a simple list you want on your WordPress website to have.\r\n\r\n<strong>Backup, Backup, Backup your site</strong>... Make sure your site is backed up daily.Â  A common mis-conseption is that your web hosts is backing up your site.Â  10 years ago, this was the case.Â  Now backups are an added feature you have to add to your hosting plan.Â  Godaddy for example has a 2.00/month add on that backups and give you access to the history restore tool.Â  I talk to people all the time who think their hosts is backing up the site.Â  Then if the site goes down, they call the host and find out this is the case.\r\n\r\nDon\'t backup using a plugin that stores a package inside your website install.Â  Backup Buddy for example, this plugin creates a backup (site files and database) and stores the zip file on your hosting account.Â  If a hack gets to the package, they have access to your database. All your user account info happens to be sitting in there.<a href=\"https://travisbuck.com/wp-content/uploads/2016/10/history-view.png\" rel=\"nofollow\"><img class=\"alignright wp-image-793 size-medium\" src=\"https://travisbuck.com/wp-content/uploads/2016/10/history-view-600x248.png\" alt=\"history-view\" width=\"600\" height=\"248\" /></a>\r\n\r\nI like an off-site solution like Blogvault.Â  It backs the site up remotely ever 24 hours, and keeps a history you can one click restore from <a href=\"http://blogvault.net/\" rel=\"nofollow\">blogvault.net</a>\r\n\r\n<strong>Install a firewall</strong>. Makesure your website is running a firewall to help block maliscious items from getting through to your site.Â  Most quality web hosts have good firewalls installed, but if your on a cheaper share web hosts like Hostgator that thing is not going to save you.\r\n\r\nThere are a lot of good firewall plugins.\r\n\r\nWP Ninja Firewall does a good job blocking hack attempts. The setup is a little tougher, but the results are worth it. <a href=\"https://wordpress.org/plugins/ninjafirewall/\" rel=\"nofollow\">https://wordpress.org/plugins/ninjafirewall/</a>\r\n\r\nAll in one security is also a great little plugin. Great all around easy to setup firewall. <a href=\"https://wordpress.org/plugins/all-in-one-wp-security-and-firewall/\" rel=\"nofollow\">https://wordpress.org/plugins/all-in-one-wp-security-and-firewall/</a>\r\n\r\nhttps://www.youtube.com/watch?v=CJvCTlVtazA\r\n\r\n<strong>Security and scanner tool</strong>. Wordfence is a good all round scanner.Â  It will help limit login attempts on your site, and the scan tool will scan your website for maliscious code and send you out a simple email report.\r\n\r\nWordfence <a href=\"https://wordpress.org/plugins/wordfence/\" rel=\"nofollow\">https://wordpress.org/plugins/wordfence/</a>\r\n\r\nThe other one I like is Shield WordPress Security. Not as well known, but I think its a little more userfriendly, <a href=\"https://wordpress.org/plugins/wp-simple-firewall/\" rel=\"nofollow\">https://wordpress.org/plugins/wp-simple-firewall/</a>\r\n\r\nThere are a lot of factors that play into your websites security. It\'s not just a \"keep your plugins updated\" mentality. You need a web person that will look and build your website from the bottom up. Quality hosting platform, solid theme code, plugins from quality developer. They you can add in the firewalls, and back-up plugins.Â  My email is always open.\r\n[yasr_overall_rating]','','2016-10-21 11:52:49','2016-10-21 11:52:49','','','2016-10-21 12:07:04','2016-10-21 12:07:04','some-simple-security-additions-for-your-website','0','','publish','Some simple security additions for your website','post',''),(
