'798','0','closed','http://travisbuck.com/792-revision-v1/','0','closed','','2','This month I saw a hacked website with over 420 hacked files. Some were inserted into the websites hosting area, and some were just modified website files.Â  These usually have a MD5 check some (MD5 which stands for Message Digest algorithm 5). Hacked files use this as a long string of letters and numbers that sort of self expands and gives out malisious commands. These code commands can live inside this long string of MD5 gererated numbers waiting for another file to read the code and then act on it.\r\n\r\nI see this a lot in WordPress, and there are just rogue servers online \"ping-ing\" websites trying to find sites with exploits to insert their code.Â  This is why so many people say \"update your plugins\".Â  As coded items like plugin scripts age, new exploits are found all the time.Â  Good developers write patches and fix holes in the code as they find them.\r\n\r\nHere is a simple list you want on your WordPress website to have.\r\n\r\n<strong>Backup, Backup, Backup your site</strong>... Make sure your site is backed up daily.Â  A common mis-conseption is that your web hosts is backing up your site.Â  10 years ago, this was the case.Â  Now backups are an added feature you have to add to your hosting plan.Â  Godaddy for example has a 2.00/month add on that backups and give you access to the history restore tool.Â  I talk to people all the time who think their hosts is backing up the site.Â  Then if the site goes down, they call the host and find out this is the case.\r\n\r\nDon\'t backup using a plugin that stores a package inside your website install.Â  Backup Buddy for example, this plugin creates a backup (site files and database) and stores the zip file on your hosting account.Â  If a hack gets to the package, they have access to your database. All your user account info happens to be sitting in there.<a href=\"https://travisbuck.com/wp-content/uploads/2016/10/history-view.png\" rel=\"nofollow\"><img class=\"alignright wp-image-793 size-medium\" src=\"https://travisbuck.com/wp-content/uploads/2016/10/history-view-600x248.png\" alt=\"history-view\" width=\"600\" height=\"248\" /></a>\r\n\r\nI like an off-site solution like Blogvault.Â  It backs the site up remotely ever 24 hours, and keeps a history you can one click restore from <a href=\"http://blogvault.net/\" rel=\"nofollow\">blogvault.net</a>\r\n\r\n<strong>Install a firewall</strong>. Makesure your website is running a firewall to help block maliscious items from getting through to your site.Â  Most quality web hosts have good firewalls installed, but if your on a cheaper share web hosts like Hostgator that thing is not going to save you.\r\n\r\nThere are a lot of good firewall plugins.\r\n\r\nWP Ninja Firewall does a good job blocking hack attempts. The setup is a little tougher, but the results are worth it. <a href=\"https://wordpress.org/plugins/ninjafirewall/\" rel=\"nofollow\">https://wordpress.org/plugins/ninjafirewall/</a>\r\n\r\nAll in one security is also a great little plugin. Great all around easy to setup firewall. <a href=\"https://wordpress.org/plugins/all-in-one-wp-security-and-firewall/\" rel=\"nofollow\">https://wordpress.org/plugins/all-in-one-wp-security-and-firewall/</a>\r\n\r\nhttps://www.youtube.com/watch?v=CJvCTlVtazA\r\n\r\n<strong>Security and scanner tool</strong>. Wordfence is a good all round scanner.Â  It will help limit login attempts on your site, and the scan tool will scan your website for maliscious code and send you out a simple email report.\r\n\r\nWordfence <a href=\"https://wordpress.org/plugins/wordfence/\" rel=\"nofollow\">https://wordpress.org/plugins/wordfence/</a>\r\n\r\nThe other one I like is Shield WordPress Security. Not as well known, but I think its a little more userfriendly, <a href=\"https://wordpress.org/plugins/wp-simple-firewall/\" rel=\"nofollow\">https://wordpress.org/plugins/wp-simple-firewall/</a>\r\n\r\nThere are a lot of factors that play into your websites security. It\'s not just a \"keep your plugins updated\" mentality. You need a web person that will look and build your website from the bottom up. Quality hosting platform, solid theme code, plugins from quality developer. They you can add in the firewalls, and back-up plugins.Â  My email is always open.\r\n[yasr_overall_rating]','','2016-10-21 11:59:19','2016-10-21 11:59:19','','','2016-10-21 11:59:19','2016-10-21 11:59:19','792-revision-v1','792','','inherit','Some simple security additions for your website','revision',''),(
