round-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}\" el_id=\"testimonials\"][vc_column wap_class=\"\"][testimonial number=\"4\"][/vc_column][/vc_row][vc_row css=\".vc_custom_1453642687397{padding-top: 150px !important;padding-bottom: 150px !important;}\" el_id=\"tech\"][vc_column wap_class=\"\"][heading text=\"Technologies\" tag=\"h2\" align=\"center\" class=\"title\"][heading text=\"I\'ve built ecommerce and large membership sites\" tag=\"h3\" align=\"center\" class=\"slogan\"][line_solid icon=\"user2\" style=\"style1\"][vc_row_inner][vc_column_inner width=\"1/2\"][vc_single_image image=\"783\" img_size=\"full\"][vc_single_image image=\"784\" img_size=\"medium\"][vc_single_image image=\"543\" img_size=\"full\"][/vc_column_inner][vc_column_inner width=\"1/2\"][vc_custom_heading text=\"WordPress and Woocommerce\" use_theme_fonts=\"yes\"][vc_column_text]Woocommerce Expert. I\'ve been building e-commerce sites with WordPress and Woocommerce for over 5 years now.\r\n\r\nI\'ve been building WordPress websites for 10 years now.Â  Custom themes, plugins, or fixing hacked WordPress sites.Â  The amount of time I have spent with WordPress sets me apart from your average web designer.\r\n\r\n[/vc_column_text][vc_custom_heading text=\"Domains and Hosting\" use_theme_fonts=\"yes\"][vc_column_text]I\'ve ran my own web hosting company since 2009.Â  Now this is mostly for myself or friends, but anyone can signup.Â  I stopped promoting my hosting a few years ago since there have been better hosting companies with larger support staff popping up year after year.Â  However, from this experience I know many hosting and server specific issues your website faces. Most things people face when they need to contact hosting support, I can troubleshoot myself.[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row css=\".vc_custom_1453674190796{padding-top: 170px !important;padding-bottom: 170px !important;backg