big redesign and you want a professional website where you know it will just get handled by the pro. Expect to pay that 5k to 10k range. Don\'t just use the one person freelancing either. This is where you higher the small web shop and they have a team to help project manage the whole process.\r\n\r\nThe larger custom sites that need a small team, and need a lot of custom coded items happening like API\'s and different interfaces, client login areas, membership areas, large e-commerce. These usually fall into the 25k and up pricing.Â  This is because a small team of web people will spend 300-400 hours developing and troubleshooting these sites. Larger sites like this usually take 3-6 months to plan and build well. Once you divide that 25k up over 6 months and between 6 employees, you will see the web company isn\'t just sitting there raking in the money.\r\n\r\n<strong>[yasr_overall_rating]</strong>','','2016-11-23 13:33:11','2016-11-23 13:33:11','','','2016-11-23 13:33:11','2016-11-23 13:33:11','805-revision-v1','805','','inherit','How much does a website cost','revision',''),(
