'813','0','open','https://travisbuck.com/?p=813','0','open','','2','We re-build a lot of new sites this time of year.Â  January is just a good time to start planning your year, and a new website should be part of that plan. Especially since Google is now pushing for https, and will soon start to flag certain sites without the added step for security.\r\n\r\nGoogle wants your site to load fast and display well on mobile.Â  If your current site doesn\'t do either of these things, expect Google to leave you behind.','','2017-01-09 14:39:53','2017-01-09 14:39:53','','','2017-01-09 14:39:53','2017-01-09 14:39:53','new-year-new-website','0','','publish','New Year new website','post',''),(
