'818','0','open','https://travisbuck.com/?p=818','0','open','','2','I\'m a member of a dozen or so web design groups spread across Linkedin and Facebook. One thing I noticed recently is a post about needing to charge to have a meeting with clients. I didn\'t think much of it at first, but people were commenting about how they charge for meetings. Things like 30min free and then their hourly rate applies. I\'m sitting here wondering how this became a thing?Â  In this industry you have to meet clients either in person or by phone. One website project will probably have a 1hr meeting up front and possibly a 2 hour meeting for the project kickoff.Â  I know it takes a lot of time (free time), but in order to make a website that meets the clients needs you need to understand what they are trying to do online.\r\n\r\nIf you find yourself talking to a web person and they want to charge you to meet to talk about your website project just run. I\'m not sure about their strategy. Maybe they have soo much work coming in that you need to pay for them to take time away to meeting with you.Â  My other thought is that they are starving for work and are trying to keep money coming in because they can\'t land the project.\r\n\r\nFind a web person or a web company where you can go to them and meet face to face. I have clients all over the US and even other parts of the world, but really its the local person down the street who ends up finding me.Â  If you want to talk to a web person like me and happen to be in Australia well we have Google chat and Skype and its not going to cost you anything until I touch some code.\r\n\r\n&nbsp;\r\n\r\n[yasr_overall_rating]','','2017-03-13 11:43:58','2017-03-13 11:43:58','','','2017-03-13 11:43:58','2017-03-13 11:43:58','does-your-web-designer-charge-to-meet-with-them','0','','publish','Does your web designer charge to meet with them','post',''),(
