'825','0','open','https://travisbuck.com/?p=825','0','open','','2','<a href=\"https://travisbuck.com/wp-content/uploads/2017/06/hacked-facebook.jpg\"><img class=\"alignright wp-image-826 size-thumbnail\" src=\"https://travisbuck.com/wp-content/uploads/2017/06/hacked-facebook-110x110.jpg\" alt=\"\" width=\"110\" height=\"110\" /></a>Is this the person who built your WordPress site? I\'m in a few different Facebook groups and this was a gem I spotted.Â  Someone who is a print designer setup WordPress (because it was easy) and now the site is hacked. It\'s unfortunate for the client and unfortunate for the industry.Â  There are soo many things a web person will know.Â  Mostly backup the site. Daily backups, got it? Daily backups..Maybe say this a few more times.\r\n\r\nThere is soo much more to a website than just installing WordPress. Basically installing WordPress can be as simple as buying a domain. It\'s situations like this that are avoidable.Â  If the site was backedup, it could be reverted with ease. If the site were built by a web person who knew they were responsible with keeping it live and unhacked, there would have been a security and firewall in place.\r\n\r\nBetter yet your web developer is probably not out there on social media asking for help, they probably are opening up the site code, finding the exploit and figuring out how they can harden the security after it\'s fixed.\r\n\r\nNo one should let just any graphic desiner setup their WordPress website.','','2017-06-09 13:53:40','2017-06-09 13:53:40','','','2017-07-08 10:42:41','2017-07-08 10:42:41','graphic-designer-are-not-web-designers','0','','publish','Graphic Designers are not Web Designers','post',''),(
